import logo from './logo.svg';
import image from './image/logo1.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img style={{width:"300px", marginLeft: "800px"}}src={image}/>

        <img style={{marginLeft: "800px"}} src={logo} className="App-logo" alt="logo" />
        <img style={{marginLeft: "851px"}} src={logo} className="App-logo1" alt="logo" />
        <p style={{marginLeft: "800px"}}>
          Website đang trong quá trình xây dựng.
      Xin vui lòng quay lại sau.</p>

      </header>
    </div>
  );
}

export default App;
